i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4073,"ei":4086,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4087,"ei":4093,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc"  nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc"  nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc">DOCS_modelChunk = [{"ty":"is","ibi":4094,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe same is true of business. Great companies can be built on open but unsuspected secrets about how the world works. Consider the Silicon Valley startups that have harnessed the spare capacity that is all around us but often ignored. Before Airbnb, travelers had little choice but to pay high prices for a hotel room, and property owners couldn’t easily and reliably rent out their unoccupied space. Airbnb saw untapped supply and unaddressed demand where others saw nothing at all. The same is true of private car services Lyft and Uber. Few people imagined that it was possible to build a billion-dollar business by simply connecting people who want to go places with people willing to drive them there. We already had state-licensed taxicabs and private limousines; only by believing in\n\nMay 26, 2015\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cand looking for secrets could you see beyond the convention to an opportunity hidden in plain sight. The same reason that so many internet companies, including Facebook, are often underestimated—their very simplicity—is itself an argument for secrets. If insights that look so elementary in retrospect can support important and valuable businesses, there must remain many great companies still to start.\n\nMay 26, 2015\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo when thinking about what kind of company to build, there are two distinct questions to ask: What secrets is nature not telling you? What secrets are people not telling you?\n\nMay 26, 2015\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSecrets about people are relatively underappreciated. Maybe that’s because you don’t need a dozen years of higher education to ask the questions that uncover them: What are people not allowed to talk about? What is forbidden or taboo\n\nThat they aren\u0027t happy with their work\n\nJune 8, 2015\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best place to look for secrets is where no one else is looking. Most people think only in terms of what they’ve been taught; schooling itself aims to impart conventional wisdom. So you might ask: are there any fields that matter but haven’t been standardized and institutionalized? Physics, for example, is a real major at all major universities, and it’s set in its ways.\n\nMay 26, 2015\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNutrition matters for everybody, but you can’t major in it at Harvard. Most top scientists go into other fields. Most of the big studies were done 30 or 40 years ago, and most are seriously flawed. The food pyramid that told us to eat low fat and enormous amounts of grains was probably more a product of lobbying by Big Food than real science; its chief impact has been to aggravate our obesity epidemic. There’s plenty more to learn: we know more about the physics of faraway stars than we know about human nutrition. It won’t be easy, but it’s not obviously impossible: exactly the kind of field that could yield secrets.\n\nLike game design\n\nJune 8, 2015\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn practice, there’s always a golden mean between telling nobody and telling everybody—and that’s a company. The best entrepreneurs know this: every great business is built around a secret that’s hidden from the outside. A great company is a conspiracy to change the world; when you share your secret, the recipient becomes a fellow conspirator. As Tolkien wro\n\nJune 8, 2015\n\u001c113\n\u0011\n\u0011\n\n\n9. Foundations\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs a founder, your first job is to get the first things right, because you cannot build a great company on a flawed foundation.\n\nJune 8, 2015\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 26, 2015\n\u001c120\n\u0011\n\u0011\n\n\n10. The Mechanics of Mafia\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA startup is a team of people on a mission, and a good culture is\n\nMay 27, 2015\n\u001c127\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cjust what that looks like on the inside.\n\nMay 27, 2015\n\u001c127\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 27, 2015\n\u001c130\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001canswers about your mission and answers about your team. You’ll attract the employees you need if you can explain why your mission is compelling: not why it’s important in general, but why you’re doing something important that no one else is going to get done. That’s the only thing that can make its importance unique. At PayPal, if you were excited by the idea of creating a new digital currency to replace the U.S. dollar, we wanted to talk to you; if not, you weren’t the right fit. However, even a great mission is not enough. The kind of recruit who would be most engaged as an employee will also wonder: “Are these the kind of people I want to work with?” You should be able to explain why your company is a unique match for him personally. And if you can’t do that, he’s probably not the right match. Above all, don’t fight the perk war. Anybody who would be more powerfully swayed by free laundry pickup or pet day care would be a bad addition to your team. Just cover the basics like health insurance and then promise what no others can: the opportunity to do irreplaceable work on a unique problem alongside great peopl\n\nMay 27, 2015\n\u001c130\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4103},{"ty":"te","id":"i.13","spi":4928},{"ty":"te","id":"i.14","spi":5366},{"ty":"te","id":"i.15","spi":5576},{"ty":"te","id":"i.16","spi":5884},{"ty":"te","id":"i.17","spi":6295},{"ty":"te","id":"i.18","spi":6972},{"ty":"te","id":"i.19","spi":7384},{"ty":"te","id":"i.20","spi":7546},{"ty":"te","id":"i.21","spi":7608},{"ty":"te","id":"i.22","spi":7708},{"ty":"te","id":"i.23","spi":7783},{"ty":"te","id":"i.24","spi":7816},{"ty":"as","st":"paragraph","si":4094,"ei":4094,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4095,"ei":4095,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4096,"ei":4096,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4098,"ei":4098,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4100,"ei":4100,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":