","ibi":8971,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwe needed every new hire to be equally obsessed.\n\nMay 27, 2015\n\u001c132\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 27, 2015\n\u001c133\n\u0011\n\u0011\n\n\n11. If You Build It, Will They Come?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s better to think of distribution as something essential to the design of your product. If you’ve invented something new but you haven’t invented an effective way to sell it, you have a bad business—no matter how good the product.\n\nMay 27, 2015\n\u001c140\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTwo metrics set the limits for effective distribution. The total net profit that you earn on average over the course of your relationship with a customer (Customer Lifetime Value, or CLV) must exceed the amount you spend on average to acquire a new customer (Customer Acquisition Cost, or CAC). In general, the higher the price of your product, the more you have to spend to make a sale—and the more it makes sense to spend it. Distribution methods can be plotted on a continuum:\n\nMay 27, 2015\n\u001c141\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA product is viral if its core functionality encourages users to invite their friends to become users too. This is how Facebook and PayPal both grew quickly: every time someone shares with a friend or makes a payment, they naturally invite more and more people into the network. This isn’t just cheap—it’s fast, too. If every new user leads to more than one additional user, you can achieve a chain reaction of exponential growth. The ideal viral loop should be as quick and frictionless as possible.\n\nMay 28, 2015\n\u001c146\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cviews very quickly because they have extremely short cycle times: people see the kitten, feel warm inside, and forward it to their friends in a matter of seconds.\n\nMay 28, 2015\n\u001c146\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt PayPal, our initial user base was 24 people, all of whom worked at PayPal. Acquiring customers through banner advertising proved too expensive. However, by directly paying people to sign up and then paying them more to refer friends, we achieved extraordinary growth. This strategy cost us $20 per customer, but it also led to 7% daily growth, which meant that our user base nearly doubled every 10 days. After four or five months, we had hundreds of thousands of users and a viable opportunity to build a great company by servicing money transfers for small fees that ended up greatly exceeding our customer acquisition cost.\n\nMay 28, 2015\n\u001c146\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhoever is first to dominate the most important segment of a market with viral potential will be the last mover in the whole market\n\nMay 28, 2015\n\u001c146\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSelling your company to the media is a necessary part of selling it to everyone else. Nerds who instinctively mistrust the media often make the mistake of trying to ignore it. But just as you can never expect people to buy a superior product merely on its obvious merits without any distribution strategy, you should never assume that people will admire your company without a public relations strategy. Even if your particular product doesn’t need media exposure to acquire customers because you have a viral distribution strategy, the press can help attract investors and employees. Any prospective employee worth hiring will do his own diligence; what he finds or doesn’t find when he googles you will be critical to the success of your company.\n\nMay 28, 2015\n\u001c147\n\u0011\n\u0011\n\n\n12. Man and Machine\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most valuable businesses of coming decades will be built by entrepreneurs who seek to empower people rather than try to make them obsolete.\n\nMay 28, 2015\n\u001c151\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThink of what professionals do in their jobs today. Lawyers must be able to articulate solutions to thorny problems in several different ways—the pitch changes depending on whether you’re talking to a client, opposing counsel, or a judge. Doctors need to marry clinical understanding with an ability to communicate it to non-expert patients. And good teachers aren’t just experts in their disciplines: they must also understand how to tailor their instruction to different individuals’ interests and learning styles. Computers might be able to do some of these tasks, but they can’t combine them effectively. Better technology in law, medicine, and education won’\n\nMay 28, 2015\n\u001c159\n\u0011\n\u0011"},{"ty":"te","id":"i.25","spi":8980},{"ty":"te","id":"i.26","spi":9063},{"ty":"te","id":"i.27","spi":9135},{"ty":"te","id":"i.28","spi":9403},{"ty":"te","id":"i.29","spi":9917},{"ty":"te","id":"i.30","spi":10452},{"ty":"te","id":"i.31","spi":10649},{"ty":"te","id":"i.32","spi":11313},{"ty":"te","id":"i.33","spi":11479},{"ty":"te","id":"i.34","spi":12284},{"ty":"te","id":"i.35","spi":12462},{"ty":"as","st":"paragraph","si":8971,"ei":8971,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8972,"ei":8972,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8973,"ei":8973,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8975,"ei":8975,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell