:"text","si":11449,"ei":11462,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":11482,"ei":12231,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12232,"ei":12245,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12256,"ei":12286,"sm":{"ts_un":false,"ts_un_i":true,"ts_it_i":false,"ts_fs_i":false,"ts_ff_i":false,"ts_fgc":"#000000","ts_fgc_i":true,"ts_it":true,"ts_bd_i":false,"ts_va_i":true,"ts_fs":16.0,"ts_ff":"Droid Serif","ts_bd":false}},{"ty":"as","st":"text","si":12287,"ei":12431,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12432,"ei":12445,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12465,"ei":13129,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":13130,"ei":13143,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc"  nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc"  nonce="JFH8bwweyAGbI5SI6CaLm2+EyKc">DOCS_modelChunk = [{"ty":"is","ibi":13151,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001creplace professionals; it will allow them to do even more.\n\nMay 28, 2015\n\u001c159\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe’re impressed with small feats accomplished by computers alone, but we ignore big achievements from complementarity because the human contribution makes them less uncanny. Watson, Deep Blue, and ever-better machine learning algorithms are cool. But the most valuable companies in the future won’t ask what problems can be solved with computers alone. Instead, they’ll ask: how can computers help humans solve hard problems?\n\nJune 13, 2017\n\u001c161\n\u0011\n\u0011\n\n\n13. Seeing Green\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe ambiguity between social and financial goals doesn’t help. But the ambiguity in the word “social” is even more of a problem: if something is “socially good,” is it good for society, or merely seen as good by society? Whatever is good enough to receive applause from all audiences can only be conventional, like the general idea of green energy\n\nJune 2, 2015\n\u001c182\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cProgress isn’t held back by some difference between corporate greed and nonprofit goodness; instead, we’re held back by the sameness of both.\n\nJune 2, 2015\n\u001c182\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJust as corporations tend to copy each other, nonprofits all tend to push the same priorities. Cleantech shows the result: hundreds of undifferentiated products all in the name of one overbroad goal. Doing something different is what’s truly good for society—and it’s also what allows a business to profit by monopolizing a new market. The best projects are likely to be overlooked, not trumpeted by a crowd; the best problems to work on are often the ones nobody else even tries to solve.\n\nJune 2, 2015\n\u001c182\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 2, 2015\n\u001c186\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe 1990s had one big idea: the internet is going to be big . But too many internet companies had exactly that same idea and no others. An entrepreneur can’t benefit from macro-scale insight unless his own plans begin at the micro-scale. Cleantech companies faced the same problem: no matter how much the world needs energy, only a firm that offers a superior solution for a specific energy problem can make money. No sector will ever be so important that merely participating in it will be enough to build a great company.\n\nJune 2, 2015\n\u001c187\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cParadoxically, the challenge for the entrepreneurs who will create Energy 2.0 is to think small.\n\nJune 2, 2015\n\u001c187\n\u0011\n\u0011\n\n\n14. The Founder’s Paradox\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFounders are important not because they are the only ones whose work has value, but rather because a great founder can bring out the best work from everybody at his company.\n\nJune 2, 2015\n\u001c209\n\u0011\n\u0011\n\n\nConclusion: Stagnation or Singularity?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOur task today is to find singular ways to create the new things that will make the future not just different, but better—to go from 0 to 1. The essential first step is to think for yourself. Only by seeing our world anew, as fresh and strange as it was to the ancients who saw it first, can we both re-create it and preserve it for the future.\n\nJune 2, 2015\n\u001c215\n\u0011\n\u0011"}
}'


